import React from "react";
import styled from "styled-components";
import logo from "../images/logo-uai.webp";
import { MdEmail, MdLocationPin } from "react-icons/md";
import { AiFillPhone } from "react-icons/ai";

const FooterStyled = styled.div`
  background-color: #18191a;
  color: #fff;
  display: flex;
  padding: 3rem;

  h1 {
    font-family: "Inter", sans-serif;
  }
  div.left-part {
    flex: 1;
    img {
      width: 30%;
    }
  }
  div.right-part {
    flex: 1;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    p {
      font-weight: 300;
      font-size: 1.5rem;
    }
  }
`;

const Footer = () => {
  return (
    <FooterStyled>
      <div className="left-part">
        <img src={logo} alt="UAI logo" />
        <h1>PT Universal Agrobisnis Indonesia</h1>
      </div>
      <div className="right-part">
        <p>
          <AiFillPhone /> +62 811 9444 283
        </p>
        <p>
          <MdEmail /> universalagrobisnis@gmail.com
        </p>
        <p>
          <MdLocationPin />
          Jl. Raya Abdullah Safe'i No.1 / Tebet Utara Dalam No.34, RT.5/RW.1,
          Tebet Tim., Tebet, Kota Jakarta Selatan, Daerah Khusus Ibukota Jakarta
          12820
        </p>
      </div>
    </FooterStyled>
  );
};

export default Footer;
